import React from 'react';
import ReactDOM from 'react-dom';
import MichaelScott from './MichaelScott.png'

const CharacterCard = () => {
  return (
    <div className="ui card">
      <div>
        <img className="ui medium circular image" src={MichaelScott} alt="Michael Scott" />
      </div>
      <div className="content">
        <a className="header">Michael Scott</a>
        <div className="description">
          Regional Manager
        </div>
      </div>
    </div>
  );
};

export default CharacterCard;
